import React from 'react';

export const ContactPage = () => {
    return (
      <div>
        <h1 >P-AI</h1>
        <h2> Team members: </h2>
        <ul>
          <li> Bennet Matazzoni </li>
          <li> Ethan </li>
          <li> Aimee </li>
          <li> George </li>
          <li> Caleb </li>
          <li> Gada </li>
        </ul>
      </div>
    );
  };
